import polymath_logo from "./images/polymath_logo.jpg";
import "./BootstrapNavbar.css";
import { useCallback, useEffect, useState } from "react";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import Offcanvas from "react-bootstrap/Offcanvas";
import MediaQuery from "react-responsive";

function BootstrapNavbar() {
  return (
    <div>
      <MediaQuery query="(max-width: 767px)"></MediaQuery>
      <MediaQuery query="(min-width: 768px)">
        <div className="navbar-pc-wrapper">
          <div className="navbar-width px-3 pt-3">
            <div className="navbar-pc navbar-font-size ">
              <div>
                <img src={polymath_logo} className="polymath-logo" />
              </div>
              <div>
                <a className="nav-link-decoration" href="#home">Home</a>
              </div>
              <div>
                <a className="nav-link-decoration" href="#team">Team</a>
              </div>
              <div>
                <a className="nav-link-decoration" href="#value">Value</a>
              </div>
              <div>
                <a className="nav-link-decoration" href="#achievements">Achievements</a>
              </div>
              <div>
                <a className="nav-link-decoration" href="#contact">Contact</a>
              </div>
              <div>
                <a className="nav-link-decoration" href="#social">Social</a>
              </div>
            </div>
          </div>
        </div>
      </MediaQuery>
    </div>
  );
}

export default BootstrapNavbar;
